import React, { Component } from "react";
import "./About.css";

export class About extends Component {
  render() {
    return (
      <div className="repair-whole">
        <div className="jumbotron jumbotron-fluid jumbotron-repair">
          <div className="container"></div>
        </div>
      </div>
    );
  }
}
